import React, {Component} from 'react';
import { render } from 'react-dom';

interface Props {
    num: string,
    title: string,
    subtitle: string,
    overviewText: string,
    overviewOptions: {},
    recommendationsText: string,
    recommendationsOptions: {},
    videoUrl: string,
};

class Step extends Component<Props> {

    render() {
        const {
            num, 
            title, 
            subtitle, 
            overviewText, 
            overviewOptions, 
            recommendationsText, 
            recommendationsOptions,
            videoUrl } = this.props;

        return (
            <div>
                <h4>Step { key }</h4>
                <h2>{ title }</h2>
                <h5> { subtitle }</h5>

            </div>
        );
    };
};

export default Step;
